import React from "react";
import Room from "./Room";

function RoomsList({ room }) {
  if (room.length === 0) {
    return (
      <div className="empty-search">
        <h3>No Rooms Matched</h3>
      </div>
    );
  }
  return <div>Hello from room List</div>;
}

export default RoomsList;
